import React from 'react';

class BinaryNode {
    constructor(props) {
        this.value = props ? props.value : null;
        this.left  = null;
        this.right = null;
    }

    left() {
        return this.left;
    }

    right() {
        return this.right;
    }

}

export default class BinaryTree {
    constructor() {
        this.root = null;
    }
}
